import React from "react";
import "./style.css";

// This file exports both the List and ListItem components

export default function Navbar(props) {
  return (
    <nav class="navbar navbar-expand-lg navbar-light bg-light">
       <a class = "navbar-brand" href="/">Clicky Game</a>
       <div class="mr-auto ml-auto"><h2 className={props.classState} id="gameStatus"> {props.message}</h2></div>
      <ul class = "navbar-nav ml-auto">
        
      <li className="ml-auto">Current Score: {props.score} |
                  Best Score: {props.bestscore} </li>
       
      </ul>
    </nav>


  );
}
